  return (
    <section>
      {data.map(function (param) {
        return (
          <div>
            <h1>userID:{param.userId}</h1>
            <h2>ID:{param.id}</h2>
            <h2>Title:{param.title}</h2>
            <h2>Body:{param.body}</h2>
          </div>
        );
      })}
    </section>
  );
}
export default Map;
